import react from 'react';
//TO  create navigation links without refreshing the page. 
// This is used to navigate between the Register and Login pages.
import { Link} from 'react-router-dom';
import './Header.css';

//This declares a functional component in React called Header.
//The const keyword is used to create a constant variable Header that stores a function.
// () => { ... } is an arrow function that defines the body of the Header component.

//The return statement is used to render the JSX(JavaScript XML) structure inside the component.

const Header = () => {
    return (
        
      <header className="header">

        <h1> Auth Testing </h1>
        <nav>
            <link to="/register" className="link">Register</link>
            <link to="/login" classname="link">Login</link>
        </nav>

        </header>
    );
};

export default Header;
